<head>
    <style>
        /* style placeholder */
:root {
    /* official SEG colours*/   
    --primary-blue: rgba(46,149,222,1.0);
    --primary-navy: rgba(10,52,94,1.0);
    --primary-white: rgba(255,255,255,1.0);
    --support-dark-grey: rgba(143,143,143,1.0);
    --support-light-grey: rgba(198,198,198,1.0);
    --support-off-white: rgba(246,241,230,1.0);
    --accent-blue: rgba(17,175,219,1.0);
    --accent-orange: rgba(243,159,33,1.0);
    --accent-coral: rgba(239,112,148,1.0);

    /*additional colours*/
    --blue-ish-grey: rgba(245, 244, 250, 1.0);
    --select-box-grey: rgba(227, 227, 227, 1.0);
    --selected-blue: rgba(203, 230, 246, 1.0);
    --text-almost-black: rgba(62, 61, 73, 1.0);
    --bottom-navbar-height: 13vh;
    --very-light-grey: rgba(240,240,240,1.0);
    --results-green-dark: rgba(60,179,113,1.0);
    --results-green-light: rgba(152,251,152,1.0);
    --results-red-dark: rgba(220,20,60,1.0);
    --results-red-light: rgba(239,200,200,1.0);
    --results-blue-dark: rgba(46,149,222,1.0);
    --results-blue-light: rgba(240,248,255,1.0);
}

textarea {
    height: 200px;
    width: 800px;
}

.textarea-warn {
    border: solid 2px var(--results-red-dark);
}

#chartContainer {
    border: 1px solid var(--support-light-grey);
    margin-top: 20px;
    margin-bottom: 20px;
}

/* Styling for the popup */
.popup {
    display: none;
    max-width: 500px;
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    padding: 30px;
    background-color: white;
    border: 1px solid #ccc;
    box-shadow: 0px 2px 6px rgba(0, 0, 0, 0.3);
    z-index: 1000;
}

.close-button {
    position: absolute;
    top: 10px;
    right: 10px;
    background-color: transparent;
    border: none;
    cursor: pointer;
}

.overlay {
    display: none;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0.5);
    z-index: 900;
}


.button-container {
    display: flex; /* Use flex display to make the buttons sit next to each other */
    justify-content: space-between; /* Space them evenly within the container */
}


.input-container {
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-bottom: 5px;
}

label {
    display: block;
    margin-bottom: 5px;
}

input[type="number"],
input[type="checkbox"] {
    padding: 5px;
    border: 1px solid #ccc;
    border-radius: 4px;
}

input[type="text"],
input[type="email"],
input[type="password"] {
    padding: 5px;
    margin-bottom: 5px;
    margin-top: 5px;
    border: 1px solid #ccc;
    border-radius: 4px;
}

/*loader styling*/
.loader {
    margin: auto;
    border: 16px solid #f3f3f3; /* Light grey */
    border-top: 16px solid #2e95de; /* Blue */
    border-radius: 50%;
    width: 100px;
    height: 100px;
    animation: spin 2s linear infinite;
}

@keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
}
    </style>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.13.0/css/all.min.css">
</head>

<body>
    <div id="divGlobalWrapper" class="global-wrapper">   
        <div id="hints">
            <h4>Notes & Hints:</h4>
            <ul>
                <li>The more clearly you describe the relationships, the better the model will work.</li>
                <li>If your first attempt does not succeed, try again!</li>
                <li>Make sure you are logged in.</li>
                <li>Usage is limited to 1 request every 30 seconds.</li>
            </ul>
        </div>
        <div id="Inputs">
            <h4>Input:</h4>
            <label for="directionPick">In which direction do you want the chart to flow?</label>
            <select name="direction" id="directionPick">
                <option value="TD">Top to Bottom</option>
                <option value="BT">Bottom to Top</option>
                <option value="LR">Left to Right</option>
                <option value="RL">Right to Left</option>
            </select>
            <br>
            <br>
            <label>Describe your flowchart:</label>
            <textarea id="userInput"></textarea>
            <br>
            <br>
            <button id="recallSeconds" class="sqs-button-element--primary" onclick="window.gogogo()">Draw it</button>
            <h4>Result:</h4>
            <div id="chartContainer">
                <p></p>
            </div>
        </div>
    </div>
    <!-- Popup and overlay elements -->
    <div class="overlay" id="overlay"></div>
    <div class="popup" id="popup">
     <div id="popupContent">
         <!-- Content will be populated here -->
     </div>
    </div>
